import React from "react";

const Section = ({ title, data, type }) => {
    return (
        <div className="card mb-4">
            {/* Change card-header background to match the header theme */}
            <div className="card-header" style={{ backgroundColor: "#013365", color: "white" }}>
                {title}
            </div>
            <div className="card-body">
                <table className="table">
                    <thead>
                    {type === "applications" && (
                        <tr>
                            <th>Durum</th>
                            <th>Tarih</th>
                            <th>Saat</th>
                            <th></th>
                        </tr>
                    )}
                    {type === "feedbacks" && (
                        <tr>
                            <th>Durum</th>
                            <th>Aktivite</th>
                            <th>Tarih</th>
                            <th>Saat</th>
                            <th>Oy</th>
                            <th>Geri Bildirim</th>
                        </tr>
                    )}
                    </thead>
                    <tbody>
                    {data.map((item, index) => (
                        <tr key={index}>
                            {type === "applications" && (
                                <>
                                    <td>{item.status}</td>
                                    <td>{item.date}</td>
                                    <td>{item.time}</td>
                                    <td>
                                        {item.action ? (
                                            <a href="#" className="btn btn-sm" style={{ backgroundColor: "#004080", color: "white" }}>
                                                {item.action}
                                            </a>
                                        ) : null}
                                    </td>
                                </>
                            )}
                            {type === "feedbacks" && (
                                <>
                                    <td>{item.status}</td>
                                    <td>{item.activity}</td>
                                    <td>{item.date}</td>
                                    <td>{item.time}</td>
                                    <td>
                                        {[...Array(5)].map((_, i) => (
                                            <i
                                                key={i}
                                                className={`fas fa-star ${i < item.stars ? "text-warning" : "text-secondary"}`}
                                            ></i>
                                        ))}
                                    </td>
                                    <td>
                                        <i className="fas fa-pen" style={{ color: "#004080" }}></i>
                                    </td>
                                </>
                            )}
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default Section;
